import React from "react";

const Card = ({tour}) => {
    const removeCard = (e) => {
        console.log()
    }
    return(
        <div>
            {
                tour.map( (tourInfo) => {
                    const {id , name, info, image,price} = tourInfo
                    return(
                        <div key={id} className="card">
                            <img src={image} alt="image" width="100%"/>
                            <div>
                                <p><b>{name}</b></p>
                                <p>{price}</p>
                            </div>
                            <p>{info}</p>
                            <button id={id} onClick={removeCard}>Not Interested</button>
                        </div>

                    )
                })
            }

        </div>
    )
}

export default Card
